//   },
//   {
//     path:"/register", 
//     element: <Register />,
//   },
//   {
//     path:"/login", 
//     element: <Login />,
//   }
// ]);



function App() {
  return(
    // <div className="app">
    //   <div className="container">
    //    Hello
    //   </div>
    // </div>
    <React.Fragment>
      <Routes>
        <Route exact path="/" element={<Layout />}>
          <Route index={true} element={<Home />}/>
          <Route path="/post/:id" element={<Single />} />
          <Route path="/write" element={<Write />} />
          <Route path="/register" element={<Register />} />
          {/* DO I NEED TO SAY element={<RequireAuth loginPath="/login">} */}
          <Route path="/login" element={<Login />} />        
        </Route>
      </Routes>
    </React.Fragment>
  );
}

export default App;



